import React from "react";
import { Fab, Typography } from "@mui/material";
import AddIcon from '@mui/icons-material/Add';

const Client = () => {
  return (
    <>
      <Typography variant="h4" sx={{ fontWeight: 550 }}>
        {" "}
        Clients
      </Typography>
      <Button>
<AddIcon/>
      </Button>
      <Fab color="secondary" aria-label="add">
        <AddIcon />
      </Fab>
    </>
  );
};

export default Client;
